  "Broker Comment" : "IN JULY OF 1980, NEIL HELD LICENSES FOR THE SOLICITATION OF LIFE, HEALTH, PROPERTY AND CASUALTY INSURANCE ISSUED BY THE INSURANCE DEPARTMENT OF THE STATE OF FLORIDA. THROUGH AN ADMINISTRATIVE ACTION OF THE INSURANCE COMMISSIONER, NEIL'S LICENSES AND HIS ELIGIBILITY FOR SUCH LICENSES WERE REVOKED FOR A PERIOD TWO YEARS. THIS ACTION RESULTED FROM HIS EMPLOYMENT AS LICENSED AGENT OF M & M INSURANCE AGENCY (DBA CASSAT AVE. INSURANCE AGENCY) FROM JULY UNTIL FEBRUARY OF 1980. THERE WERE CHARGES OF \"PIGGYBACK\" AGAINST THE OWNERS AND OTHER EMPLOYEES OF THIS AGENCY. AS THE LICENSED AGENT, NEIL WAS HELD ACCOUNTABLE FOR THESE VIOLATIONS. IN LATE JULY THE ADMINISTRATIVE ACTION WAS ENFORCED. AFTER SATISFYING THE STIPULATIONS OF THIS ACTION, NEIL WAS RELICENSED WITH THE INSURANCE DEPARTMENT IN AUGUST OF 1983."
